const ProxyTutorial = () => {
    return (
        <div className="proxy-tutorial">
            <h1>Hướng dẫn sử dụng Proxy</h1>
            <p>Proxy là một công cụ hữu ích giúp bạn quản lý và bảo mật kết nối internet của mình. Dưới đây là hướng dẫn chi tiết về cách sử dụng Proxy.</p>
            <ul>
                <li>Bước 1: Cài đặt phần mềm Proxy trên máy tính của bạn.</li>
                <li>Bước 2: Cấu hình địa chỉ IP và cổng của Proxy trong cài đặt mạng.</li>
                <li>Bước 3: Kiểm tra kết nối để đảm bảo mọi thứ hoạt động bình thường.</li>
            </ul>
        </div>
    );
}
export default ProxyTutorial;
